\parbox{5cm}{
\textbf{Image}:\\[0.1cm]
\setlength{\leftmargini}{1em}
\begin{itemize}\leftmargin=0pt
 \setlength{\parindent}{0pt}
 \setlength{\itemsep}{0pt}
 \setlength{\parskip}{0pt plus0.3pt minus0.3pt}
 \setlength{\parsep}{0pt}
\vspace{-0.8cm}
\item Arbitrary resolution
\item Arbitrary size
\item Intensity only (real)
\end{itemize}}

\parbox{7cm}{
\textbf{Target object}:\\[0.1cm]
\setlength{\leftmargini}{1em}
\begin{itemize}\leftmargin=0pt
 \setlength{\parindent}{0pt}
 \setlength{\itemsep}{0pt}
 \setlength{\parskip}{0pt plus0.3pt minus0.3pt}
 \setlength{\parsep}{0pt}
\vspace{-0.8cm}
\item Patch-based 3D shape
\item Arbitrary position and orientation
\item Material type specifies reflectivity
\end{itemize}}

\parbox{7cm}{
\textbf{Seafloor model}:\\[0.1cm]
\setlength{\leftmargini}{1em}
\begin{itemize}\leftmargin=0pt
 \setlength{\parindent}{0pt}
 \setlength{\itemsep}{0pt}
 \setlength{\parskip}{0pt plus0.3pt minus0.3pt}
 \setlength{\parsep}{0pt}
\vspace{-0.8cm}
\item Patch- or pixel-based 3D shape
\item Arbitrary position and orientation
\item Material type and angle specifies reflectivity
\end{itemize}}

\parbox{5cm}{
\textbf{Sonar}:\\[0.1cm]
\setlength{\leftmargini}{1em}
\begin{itemize}\leftmargin=0pt
 \setlength{\parindent}{0pt}
 \setlength{\itemsep}{0pt}
 \setlength{\parskip}{0pt plus0.3pt minus0.3pt}
 \setlength{\parsep}{0pt}
\vspace{-0.8cm}
\item Position and orientation
\item Frequency
\item Array geometry
\item Mono- or bistatic
\end{itemize}}
